webpackJsonp([0x7b94506f41a6],{8094:function(t,a){t.exports={data:{post:{html:'<p>If you bike through our village, you\'ll see the following warning as you come into to town...</p>\n<p><a href="http://www.flickr.com/photos/51035717986@N01/3597017799" title="View \'Buzzard Attack\' on Flickr.com"><img src="https://farm4.static.flickr.com/3661/3597017799_4a69a273ab.jpg" alt="Buzzard Attack" border="0" width="375" height="500" /></a></p>\n<p>Yes, our village is protected by an attack buzzard! A couple of years ago  2 cyclists were indeed attacked by a buzzard that was nesting nearby.</p>\n<p>However I have no idea how I would defend myself if I were actually attacked by the buzzard? <a href="http://www.youtube.com/watch?v=C0K_LZDXp0I">Duck and cover?</a></p>',fields:{title:"Buzzard Attack!",date:"05 Jun 2009",url:"https://papascott.de/2009-06-05-buzzard-attack/"}}},pathContext:{slug:"/2009-06-05-buzzard-attack/",prev:{fields:{title:"Spur of the Moment",date:"27 May 2009",slug:"/2009-05-27-spur-of-the-moment/"}},next:{fields:{title:"Pesky Parliament",date:"08 Jun 2009",slug:"/2009-06-08-pesky-parliament/"}}}}}});
